INSERT INTO `t_post` (`id`, `id_category`, `id_user`, `tag`, `title`, `seotitle`, `content`, `datepost`, `timepost`, `picture`, `image_caption`, `hits`, `headline`, `comment`, `active`) VALUES
(1, 2, 1, 'indonesia,jogja,goapindul,wisata', 'Wisata Kekinian di Jogja yang Seru dan Memanjakan Mata', 'wisata-kekinian-di-jogja-yang-seru-dan-memanjakan-mata', '&lt;p&gt;Yogyakarta merupakan salah satu kota yang berada di pulau Jawa. Di mana kota ini memiliki kebudayaan yang sangat kental dan sebagian besar penduduk disana memiliki sifat lemah lembut dan sangat ramah. Tak heran jika para wisatawan betah untuk berlama-lama di kota ini. Selain penduduknya yang ramah, masalah kuliner pun juga tak bisa dikalahkan. Olahan makanan disini sangat beragam dan mereka cenderung tidak pelit akan penggunaan bumbu-bumnya. Sehingga menjadikan rasa makanan yang sangat khas dengan cita rasa lain dari pada yang lain.&lt;/p&gt;\r\n&lt;p&gt;Keistimewaan Yogyakarta tertuang mulai dari keberagaman budaya, adat, kuliner serta wisata nya. Nah, di samping itu semua disini saya akan memberikan informasi tentang daya tarik wisata di kota Yogyakarta ini, yang mampu membuatmu makin betah tinggal disini. Mari kita simak!&lt;/p&gt;\r\n&lt;p&gt;&lt;!-- pagebreak --&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;br /&gt;&lt;strong&gt;1. Bukit Pengilon&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;Bukit Pengilon terkenal akan panorama alamnya yang sangat memukau. Wisata ini bisa terbilang baru, meskipun begitu di media sosial sudah banyak para wisatawan yang mengabadikan foto di tempat ini sehingga dapat menarik minat para wisatawan lain untuk berkunjung ke bukit ini. Lokasi nya berada di Tepus, Purwodadai, Gunung /kidul. Selamat mencoba!&lt;/p&gt;\r\n&lt;p&gt;&lt;br /&gt;&lt;strong&gt;2. Jembatan Pantai Timang&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;Selain unik, jembatan ini juga menantang mental para wisatawan lho. Pasalnya jembatan yang menguhubungkan antar pulau ini berada diatas pantai dengan ombak ganas yang menjadi khas Pantai Selatan. Kamu bisa mengunjungi wisata ini di Jalan Pantai Selatan Jawa, Tepus, Gunung kidul. Gimana, kamu berani coba?&lt;/p&gt;\r\n&lt;p&gt;&lt;br /&gt;&lt;strong&gt;3. The Lost World Castle&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;Nah, hiburan keluarga yang satu ini berada di Desa Kepuharjo, Cangkringan, Sleman. Tak perlu jauh-jauh ke Eropa, kamu bisa menemukan segala macam castle dengan tema yang unik di sini. Selain itu kamu juga bisa menemukan rumah hobbit yang baru-baru ini menjadi spot paling populer dan juga ada Galeri 3D serta Paradise Gate. Dijamin pasti kamu akan betah di sini!&lt;/p&gt;\r\n&lt;p&gt;&lt;!-- pagebreak --&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;br /&gt;&lt;strong&gt;4. Pantai Wedi Ombo&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;Salah satu pantai di Jogja ini memiliki spot khasnya yaitu kolam alami di tepi laut. Kolam yang berada di tengah-tengah karang yang berjajar rapi ini, berada pas disamping lautan. Kamu bisa dengan tenang menikmati segarnya air dan pemandangan yang eksotik. Namun, kamu harus tetap berhaati-hati meskpiun aman terkadang ombak ganas bisa mencapai kolam ini sehingga ditakutkan dapat menarik kamu ke tengah laut atau bahkan mendorong kamu ke batu karang yang keras. Lokasi pantai ini berada di Desa Jepitu, Gunung Kidul.&lt;/p&gt;\r\n&lt;p&gt;&lt;br /&gt;&lt;strong&gt;5. Goa Jomblang&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;Jika kamu suka tantangan, kunjungi wisata yang satu ini. Disini kamu akan disuguhkan suasana alam berbeda dari biasanya. Tempat yang pernah dijadikan lokasi syuting film Amazing Race season 19 ini, merupakan sebuah goa yang sudah memiliki umur mencapai puluhan tahun. Jika kamu ingin mengunjungi tempat ini, alangkah baiknya kamu reservasi terlebih dahulu. Karena pengunjung disini dibatasi dan persiapakan beberapa pekaian ganti pula. Wisata ini berlokasikan di Semanu, Gunung Kidul. Jangan lupa siapkan kamera untuk mengabadikan momen indah di sini&lt;/p&gt;\r\n&lt;p&gt;&lt;br /&gt;&lt;strong&gt;6. Candi&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;Di Jogja kamu bisa menemui 2 candi terbesar di Asia. Yaitu candi prambanan dan candi Borobudur. Situs ini juga menjadi situs warisan budaya dunia oleh UNESCO. Dua candi tersebut mengusung kebudayaan berbeda. Di mana Candi Prambanan merupakan Candi Hindu dan Candi Borobudur merupakan Candi Budha. Saat hari-hari besar, ke-2 candi ini sering dikunjungi baik itu untuk kegiatan kebudayaan maupun sekedar berwisata. lokasinya pun berbeda, Candi Prambanan terletak di prambanan sedangkan Candi Borobudur berada di Magelang.&lt;/p&gt;\r\n&lt;p&gt;Itulah objek wisata di Jogja yang sangat memukau. Bagaimana? Kamu tertarik untuk mengunjunginya? Sebelum itu, jangan lupa nabung dulu ya! Biar makin banyak tabungan untuk dana liburan. Tentu, kamu gak mau kan kalau sudah jauh-jauh ke jogja tapi hanya beberapa objek wisata saja yang terkunjungi. Padahal yang lain juga masih banyak yang bagus. Hehehe&lt;/p&gt;\r\n&lt;p style=&quot;text-align: right;&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;&lt;strong&gt;sastrawacana&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;&lt;a href=&quot;https://www.hipwee.com/list/7-wisata-kekinian-di-jogja-yang-seru-dan-memanjakan-mata-nggak-bakal-nyesel-liburan-ke-sana&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;https://www.hipwee.com/list/7-wisata-kekinian-di-jogja-yang-seru-dan-memanjakan-mata-nggak-bakal-nyesel-liburan-ke-sana&lt;/span&gt;&lt;/a&gt;&lt;/p&gt;', '2019-06-12', '10:14:09', 'travel-5.jpg', 'Goa Pindul', 355, 'N', 'Y', 'Y'),
(2, 2, 1, 'poso,sulteng,festivaldanauposo,budaya,wisata', 'Pesona Tana Sintuwu Maroso', 'pesona-tana-sintuwu-maroso', '&lt;p style=&quot;text-align: justify;&quot;&gt;Bak permata&amp;nbsp; yang belum diasah, mungkin pepetah tersebut kiranya cocok untuk menggambarkan potensi wisata yang dimiliki Poso. Kabupaten dengan semboyan Tana Sintuwu Maroso ini memiliki pesona pantai yang luar biasa indah. Salah satunya adalah Pantai Imboek, yang terletak diperbatasan Kelurahan Lawangan dan Tegal Rejo atau sekitar 5 km dari Kota Poso.&lt;/p&gt;\r\n&lt;p style=&quot;text-align: justify;&quot;&gt;Apabila Anda mengunjungi pantai ini mata anda akan dimanjakan dengan laut biru yang jernih dengan pasir putih yang halus. Bahkan saat ini sudah ada wahana permainan seperti banana boat yang di kelola oleh investor lokal di Pantai Imboek. Selain menikmati wahana permainan banana boat, anda juga dapat menyewa perahu batang yang disewakan oleh warga sekitar. Namun, bila anda datang ke Pantai Imboek sekedar ingin menikmati suasana alam pantai, anda dapat datang di sore hari untuk menyaksikan sunset sambil menikmati gorengan.&lt;/p&gt;\r\n&lt;p style=&quot;text-align: justify;&quot;&gt;Apabila Pantai Imboek belum cukup memuaskan, anda dapat menikmati Pantai Siuri. Pantai ini terletak di Desa Toinasa, kecamatan Pamona Barat. Untuk mencapai pantai tersebut diperlukan waktu sekitar 57 km dari Poso Kota. Akses menuju pantai tersebut cukup mudah, pengunjung dapat menggunakan kendaraan roda dua atau roda empat. Namun, jalur yang dilalui cukup sempit sehingga mungkin hanya cukup dilalui sebuah kendaraan. Selain sempit, jalur menuju pantai Siuri cukup berliku. Tapi anda tak perlu khawatir, jauhnnya perjalanan yang ditempuh sesuai dengan keindahan alam yang ditawarkan Pantai Siuri.&lt;/p&gt;\r\n&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;!-- pagebreak --&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: justify;&quot;&gt;Berbeda dengan Pantai Imboek yang memiliki pasir putih, pasir di Pantai Siuri berwarna keemasan. Pesona laut yang ditawarkan pun tak kalah indah dari Pantai Imboek. Selain kedua pantai diatas Anda juga dapat menikmati beberapa pantai lain Pantai Karawasa di Madale yang menawarkan kemolekan alam bawah laut.&lt;/p&gt;\r\n&lt;p style=&quot;text-align: justify;&quot;&gt;Pantai Karawasa merupakan &lt;em&gt;spot diving&lt;/em&gt; yang sangat indah. Bagi anda yang ingin menikmati kekayaan bahari di Poso, pantai ini merupakan tujuan yang tepat. Ada juga pantai lain seperti Pantai Toini yang terletak di Desa Toini, &amp;nbsp;Pantai Seribu Bintang yang terletak di desa Sa&amp;rsquo;atu dan lainnya. Kedua pantai ini menyajikan&amp;nbsp; suasana pantai yang masih alami dan jauh dari tangan-tangan nakal para wisatawan. Hal ini karena kedua pantai ini memang kurang populer dibanding pantai lain di Poso. Selain dapat menikmati suasana pantai yang masih alami, di Pantai Seribu Bintang anda juga dapat melihat ratusan atau bahkan mungkin ribuan bintang laut. Inilah mungkin yang menginspirasi nama dari pantai Seribu Bintang. Bukankah terasa menyenangkan dapat menikmati eksotisme kedua pantai yang masih alami ini.&lt;/p&gt;\r\n&lt;p style=&quot;text-align: justify;&quot;&gt;Bagi Anda yang tidak begitu menyukai wisata bahari, Poso masih memiliki objek wisata lain yang dapat Anda nikmati seperti Danau Poso. Bila anda sedang berada di Poso, Danau Poso merupakan salah satu destinasi yang harus Anda kunjungi. Danau dengan luas 32.300 hektar ini memiliki keunikan yaitu berpasir putih dan emas serta bergelombang. Panorama alam berupa bukit dengan pepohonan yang rimbun akan membuat segala beban pikiran anda hilang.&lt;/p&gt;\r\n&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;!-- pagebreak --&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: justify;&quot;&gt;Di Danau Poso terdapat suatu acara adat yang tiap tahun diadakan, yaitu Festival Danau Poso. Festival danau poso merupakan wujud rasa syukur masyarakat atas pemberian Tuhan Yang Maha Esa. Festival yang diselenggarakan oleh Dinas Pariwisata Poso ini rutin diperingati tiap bulan Agustus. Untuk dapat melihat Festival Danau Poso, pengunjung tidak perlu repot-repot mendaftar terlebih dahulu, karena Festival Danau Poso terbuka untuk umum. Festival Danau Poso menampilkan beragam kesenian dan budaya khas Poso, pemilihan putra-putri pariwisata Sulawesi Tengah, serta bazaar beragam souvenir dan kuliner khas Poso.&lt;/p&gt;\r\n&lt;p style=&quot;text-align: justify;&quot;&gt;Selain wisata pantai dan danau, Poso masih memiliki objek wisata lain yang dapat anda masukkan kedalam daftar liburan Anda, seperti Bancea (Taman Anggrek) yang terletak di Tentena, Air terjun Saluopa. Air Terjun Kilo, Taman Nasional Lore Lindu, Gua Tangkaboba, Situs megalitik di Lore, dan Lembah Napu.&lt;/p&gt;\r\n&lt;p style=&quot;text-align: justify;&quot;&gt;Serta masih banyak destinasi wisata lain yang dimiliki Poso. Semuanya menawarkan keindahan alam yang masih asli. Namun sayang, pengelolaan pariwisata di Poso belum menjadi perhatian utama pemerintah, sehingga beberapa objek wisata menjadi kurang terawat.&lt;/p&gt;\r\n&lt;p style=&quot;text-align: justify;&quot;&gt;Nah, ternyata cukup banyak destinasi wisata asik yang dimiliki Poso bukan! Jadi tidak salah untuk memasukkan Poso menjadi salah satu kota tujuan anda ketika berlibur ke Sulawesi Tengah.&lt;/p&gt;\r\n&lt;p style=&quot;text-align: right;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Lavia Farareta&lt;/span&gt;&lt;/strong&gt;&lt;br /&gt;&lt;em&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;&lt;a title=&quot;Pesona Tana Sintuwu Maroso&quot; href=&quot;https://travelnatic.com/wisata-poso-pesona-tana-sintuwu-maroso/&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;https://travelnatic.com/wisata-poso-pesona-tana-sintuwu-maroso&lt;/a&gt;&lt;/span&gt;&lt;/em&gt;&lt;/p&gt;', '2019-06-29', '13:19:35', 'travel-4.jpg', 'Penari Tarian Poso di Festival Danau Poso. Dok. Lavia Farareta', 429, 'Y', 'Y', 'Y'),
(3, 2, 1, 'wedding,article,wisata', 'Destinasi Wisata Hits yang Cocok Buat Foto Pre Wedding', 'destinasi-wisata-hits-yang-cocok-buat-foto-pre-wedding', '&lt;p&gt;Lorem ipsum dolor sit amet consectetur adipiscing elit curabitur nec enim id enim imperdiet commodo. Nunc id ante ac leo tempor facilisis. Mauris vulputate interdum ipsum, eu laoreet augue. Sed vestibulum a urna at fermentum. Nullam blandit dolor sollicitudin elit rutrum dictum. Pellentesque eleifend finibus lacus, vel mollis libero rutrum sed. Sed quam orci, euismod ac ipsum eu, malesuada pellentesque nunc. AdimanCifi zorbi egestas ligula a elit aliquet, a commodo quam fermentum. Aenean eget dictum purus. Sed libero nisi, euismod non semper a, bibendum vitae nulla.&lt;/p&gt;\r\n&lt;p&gt;Praesent dignissim lacinia enim non blandit suspendisse potenent esque commodo tristique ipsum ut tincidunt. Nam dapibus neque mi, sit amet euismod arcu vestibulum vel. Suspendisse vulputate congue ante ac condimentum. Praesent ultrices semper nunc eget facilisis. Donec quis leo et ex convallis pellentesque non quis mauris. Aenean a diam viverra, maximus est id, tempor diam. Praesent placerat pharetra orci et facilisis. Livia Etiam ipsum tellus, lacinia at augue aliquam, iaculis cursus est. Elinda Quisque vel justo vestibulum, tristique purus in, fermentum ante. Duis fermentum nibh vitae nulla iaculis, et blandit lectus varius. Nunc eget quam consectetur nisi eleifend maximus ut eget urna. Morbi fringilla ultricies nulla, non malesuada tellus faucibus vitae. In ipsum dolor, suscipit eu lobortis non, condimentum eget est. Nullam dictum ante eu eros lobortis mattis.&lt;/p&gt;', '2019-06-04', '09:20:25', 'travel-3.jpg', 'stone garden via www.instagram.com', 34, 'Y', 'Y', 'Y'),
(4, 2, 1, 'manado,indonesia,tinutuan,kuliner,wisata', 'Kuliner Halal yang Wajib Dicicipi di Manado', 'kuliner-halal-yang-wajib-dicicipi-di-manado', '&lt;p&gt;Tak afdol rasanya jika datang ke Manado hanya untuk menikmati alam, budaya dan kerahaman warganya tanpa mencicipi kuliner khasnya. Berikut KompasTravel rangkum 10 kuliner yang wajib Anda cicipi saat bertandang ke Manado. Tentu, makanan dalam daftar ini adalah kuliner halal.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;1. Tinutuan&lt;br /&gt;&lt;br /&gt;&lt;/strong&gt;Ini yang pertama, masakan khas Manado yang sudah sangat tersohor. Tinutuan merupakan makanan yang dibuat dari campuran berbagai sayuran hijau, dimasak dengan bubur beras dan labu kuning. Sangat cocok disantap sebagai sarapan.&lt;/p&gt;\r\n&lt;p&gt;Di hotel-hotel bintang 3 ke atas, biasanya tinutuan menjadi salah satu menu untuk breakfast. Di Manado ada pusat kuliner tinutuan. Datangilah wakeke, ada puluhan warung makan mulai dari yang sederhana sampai mewah menawarkan menu tinutuan.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;2. Cakalang Fufu&lt;br /&gt;&lt;/strong&gt;&lt;br /&gt;Ikan cakalang (Katsuwonus pelamis) atau tongkol putih yang diasapi (fufu) merupakan salah satu menu khas di Manado. Ikan yang masih segar dan langsung diasapi ini kemudian diolah menjadi berbagai menu. Salah satu olahan paling enak adalah cakalang fufu saus, atau diolah menjadi cakalang fufu santan.&lt;/p&gt;\r\n&lt;p&gt;Sajian menu ini sangat lezat disantap saat masih panas. Banyak warung makan tradisional yang menyajikan menu cakalang fufu. Jika ingin membawa pulang, bisa mendatangi pasar tradisional atau ke jembatan Sario. Di sana banyak penjual cakalang fufu yang siap di-packing untuk dibawa pulang sebagai oleh-oleh.&lt;/p&gt;\r\n&lt;p&gt;&lt;!-- pagebreak --&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;3. Dabu-dabu&lt;br /&gt;&lt;/strong&gt;&lt;br /&gt;Orang Manado nyaris tak bisa makan tanpa ditemani rasa pedas. Cabe (rica) menjadi salah satu bumbu yang paling berfluktuasi harganya karena paling dicari. Cabe diolah menjadi dabu-dabu (sambal).&lt;/p&gt;\r\n&lt;p&gt;Berbeda dengan sambal di daerah lain, dabu-dabu Manado sangat pedas. Beberapa macam dabu-dabu seperti dabu-dabu bakar, dabu-dabu iris, dabu-dabu lemong dan dabu-dabu lilang mudah dijumpai di rumah makan yang menyajikan ikan bakar.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;4. Sambal Roa&lt;br /&gt;&lt;/strong&gt;&lt;br /&gt;Ini adalah salah satu sambal khas Manado lainnya. Sangat khas, karena dibuat dari cabe yang dicampur dengan ikan roa (sejenis ikan terbang) yang sebelumnya diasap hingga kering sekali. Ikan roa yang dicampur dengan cabe itu sebelumnya ditumbuk menjadi sangat halus, lalu dimasak dengan sedikit minyak. Adonan dicampur dengan cabe rawit, bawang merah, bawang putih, tomat, garam serta gula, kemudian ditumis. Sambal roa sangat cocok menjadi pelengkap kala menyantap tinutuan. Jangan heran jika sambal roa harganya lumayan mahal.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;5. Woku Blanga&lt;br /&gt;&lt;/strong&gt;&lt;br /&gt;Ini merupakan salah satu cara orang Manado mengolah ikan. Woku blanga sejatinya dimasak di dalam belanga yang terbuat dari tanah liat. Woku merupakan campuran bumbu daun jeruk, daun pandan, daun kunyit, daun serai, kemangi dan ditambah dengan bumbu-bumbu lainnya sehingga beraroma wangi dan bercitrarasa pedas dan terasa segar. Beberapa jenis ikan yang biasa diolah menjadi masakan woku blanga adalah ikan kerapu, ikan nila, ikan mas, termasuk kepiting dan udang. Anda bisa menjumpai woku blanga di restoran khas Minahasa dan warung-warung makan tradisional.&lt;/p&gt;\r\n&lt;p&gt;&lt;!-- pagebreak --&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;6. Nasi Kuning&lt;br /&gt;&lt;/strong&gt;&lt;br /&gt;Berbeda dengan nasi kuning di daerah lain, nasi kuning khas Manado mengandalkan pelengkapnya berupa irisan ikan cakalang, serta daging sapi yang diolah dalam bentuk irisan kecil-kecil. Telur rebus juga menjadi pelengkap serta ditaburi berbagai bumbu lainnya. Nasi kuning khas Manado sering disajikan atau dibungkus di daun woka (sejenis janur). Di Wakeke juga banyak disajikan menu nasi kuning selain tinutuan. Tetapi yang paling terkenal adalah nasi kuning di Kampung Kodo atau di Rumah Makan Saroja dan Rumah Makan Selamat Pagi. Jika malam hari, puluhan penjual nasi kuning bertaburan di Komo, yang membuka lapak hingga subuh.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;7. Pisang Goreng&lt;br /&gt;&lt;/strong&gt;&lt;br /&gt;Apa yang istimewa dengan pisang goreng? Jangan salah, di Manado, pisang goreng disantap dengan dabu-dabu (sambal). Terutama sambal roa. Selain pisang sepatu yang umum, di Manado ada pisang goreng yang sangat khas. Pisang goreng goroho namanya. Pisang ini digoreng justru saat belum masak.&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Penulis : &lt;strong&gt;Kontributor Manado, Ronny Adolof Buol&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Sumber &lt;a href=&quot;https://travel.kompas.com/read/2017/02/16/130300727/10.kuliner.halal.yang.wajib.dicicipi.di.manado&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;https://travel.kompas.com/read/2017/02/16/130300727/10.kuliner.halal.yang.wajib.dicicipi.di.manado&lt;/a&gt;&lt;/span&gt;&lt;/p&gt;', '2019-06-27', '07:21:05', 'travel-1.jpg', 'Kuliner khas Manado, Tinutuan atau dikenal juga dengan sebutan Bubur Manado.', 343, 'N', 'Y', 'Y'),
(5, 2, 1, 'article,liburan,wisata', 'Destinasi Wisata Jepang yang Wajib Dikunjungi', 'destinasi-wisata-jepang-yang-wajib-dikunjungi', '&lt;p&gt;Jepang terdiri dari 6.852 pulau di Samudra Pasifik, dengan 43 prefektur berbeda. Ada begitu banyak yang bisa dilihat dan dilakukan di Jepang, kamu mungkin tidak bisa menyelesaikan semuanya dalam sekali kunjungan. Jika kamu merencanakan perjalanan ke sana, pastikan untuk mempertimbangkan mengunjungi 10 destinasi wisata Jepang teratas ini saat kamu berada di sana.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Hotel sumber mata air panas&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;Jika kamu mencari liburan yang santai, sebaiknya mempertimbangkan untuk menginap di &quot;Onsen Ryokan,&quot; yang merupakan hotel sumber air panas. Mata air panas Jepang terkenal karena khasiat penyembuhannya. Beberapa bahkan mengklaim bahwa airnya membersihkan kulit dan membalikkan penuaan. Ada hotel sumber air panas gaya modern dan tradisional untuk kamu pilih, dan ke mana pun kamu pergi di Jepang, dijamin mendapatkan sumber air panas terdekat.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Gunung Fuji&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;Jika kamu menyukai alam bebas, pertimbangkan untuk mendaki Gunung Fuji setinggi 12.388 kaki. Jalan setapak hanya buka dari Juli hingga September, karena cuaca menjadi sangat dingin di puncak gunung. Jika hanya di sana selama sehari, kamu dapat naik ke stasiun ke-5, yang merupakan perjalanan pulang pergi 12 jam. Jika merasa ingin bertualang, kamu dapat memesan akomodasi di dekat puncak gunung, sehingga dapat menyaksikan matahari terbit bersama dengan pendaki gunung lainnya. Perlu diingat bahwa ini membutuhkan waktu 24 jam penuh untuk mendaki ke puncak. Jika tidak siap untuk mendaki puncak, kamu masih dapat mengambil gambar dari jauh. Tempat paling populer untuk foto Gunung Fuji adalah Gotemba Peace Park di Gotemba City, yang buka sepanjang tahun.&lt;/p&gt;\r\n&lt;p&gt;&lt;!-- pagebreak --&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Tokyo DisneySea&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;Tokyo DisneySea, taman bertema akuatik, menjadikannya tempat sempurna untuk dikunjungi selama musim panas. Tempat ini menampilkan banyak film bertema air Disney seperti The Little Mermaid, Finding Nemo, dan 20.000 Leagues Under the Sea, serta beberapa film remaster, seperti The Tower of Terror. Ada juga seluruh area yang didedikasikan untuk Aladdin yang disebut &quot;The Arabian Coast,&quot; yang akan membuatmu merasa seolah benar-benar berjalan di sekitar kota Agrabah. Selain wahana, akomodasi taman sangat rinci, seperti Hotel Miracosta, yang merupakan rekreasi pelabuhan Mediterania. Banyak orang menyebut Tokyo DisneySea sebagai &quot;taman hiburan terbaik dunia&quot;, tetapi kamu hanya perlu mengunjungi untuk menilainya sendiri.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Akihabara dan Harajuku&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;Akihabara adalah impian penggemar anime yang menjadi kenyataan. Jalanan dipenuhi toko-toko besar yang bertema cosplay, anime, manga, dan elektronik. Tempat ini benar-benar normal untuk melihat penggemar berjalan-jalan mengenakan cosplay lengkap. Bagi kamu yang tidak tertarik dengan anime, Harajuku adalah distrik mode, dan ini adalah tempat sempurna untuk membeli pakaian yang tidak dapat kamu temukan di rumah.&lt;/p&gt;\r\n&lt;p&gt;&lt;!-- pagebreak --&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Menara Tokyo dan SkyTree&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;Tempat wisata paling terkenal di Jepang adalah Menara Tokyo, yang dibangun pada 1950-an sebagai antena untuk siaran TV. Desainnya terinspirasi oleh Menara Eiffel di Prancis. Wisatawan naik menara ke dek observasi teratas setiap hari. Namun, Menara Tokyo masih jauh dari titik tertinggi di kota. Menara tertinggi disebut SkyTree. Kedua menara ini memberikan pemandangan Tokyo yang menakjubkan, dan SkyTree bahkan memiliki pusat perbelanjaan serta akuarium sendiri. Perlu diingat bahwa tiket untuk kedua bangunan ini bisa cukup mahal, dan antreannya sangat panjang.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Kastil Matsumoto&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;Kastil Matsumoto adalah salah satu kastil yang tersisa di Jepang. Kastil itu dibangun pada tahun 1500-an, dan menampung 23 penguasa feodal yang berbeda selama masa hidupnya. Musim semi adalah salah satu waktu paling populer untuk dikunjungi, karena bunga sakura di sekitar perkebunan mekar penuh. Bagian dalam kastil telah diubah menjadi museum, menampilkan senjata yang digunakan dalam pertempuran di halaman kastil.&lt;/p&gt;\r\n&lt;p&gt;&lt;em&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Oleh : Rangga Dio Hayyunuski&lt;br /&gt;&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Sumber : &lt;/span&gt;&lt;a href=&quot;https://www.idntimes.com/travel/destination/rangga-dio-hayyunuski/10-destinasi-wisata-menarik-yang-wajib-kamu-kunjungi-di-jepang-c1c2/full&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;idntimes.com&lt;/span&gt;&lt;/a&gt;&lt;/em&gt;&lt;/p&gt;', '2019-07-05', '09:10:50', 'travel-2.jpg', '', 357, 'N', 'Y', 'Y'),
