(2, 116, 132, 'Sekretariat Badan Pengembangan Sumber Daya Manusia', 'Ir. Achmad Subki, M.T.', '&lt;p&gt;Gedung Heritage, Lantai 2 Kementerian Pekerjaan Umum dan Perumahan Rakyat Jln. Pattimuta No: 20 Kebayoran Baru Jakarta Selatan 12110&lt;/p&gt;', '021-27515703', '021-27515703', 'set_bpsdm@pu.go.id', '&lt;p&gt;Sekretariat Badan mempunyai tugas melaksanakan pelayanan teknis dan administrasi kepada seluruh unsur organisasi di lingkungan Badan Pengembangan Sumber Daya Manusia.&lt;/p&gt;', 'setba_banner.jpg', '-6.2364938', '106.7989047', 'Aktif', '2021-11-22 04:06:01', '2022-07-18 06:55:31'),
(3, 15, 133, 'Pusat Pengembangan Talenta', 'Drs. Rudy Ridwan Effendi, MT', '&lt;p&gt;Gedung Heritage, Lantai 2 Kementerian Pekerjaan Umum dan Perumahan Rakyat Jln. Pattimuta No: 20 Kebayoran Baru Jakarta Selatan 12110&lt;/p&gt;', '(021) 27513248', '(021) 27513248', 'pusat1_bpsdm@pu.go.id', '', 'pusat1.jpg', '', '', 'Aktif', '2021-11-22 06:13:54', NULL),
(4, 17, 133, 'Pusat Pengembangan Kompetensi Sumber Daya Air dan Permukiman', 'Ir. H. Ruhban Ruzziyatno, M.T.', '&lt;p&gt;Jl. Abdul Hamid No.5A, Jatihandap, Kec. Mandalajati, Kota Bandung, Jawa Barat 40195&lt;/p&gt;', '(022) 7206892', '022 - 63722273', 'pusat2_bpsdm@pu.go.id', '&lt;p&gt;Tugas Pokok:&lt;/p&gt;\r\n&lt;p&gt;Pusat Pengembangan Kompetensi Sumber Daya Air dan Permukiman mempunyai tugas melaksanakan penyusunan &amp;nbsp;kebijakan teknis dan pelaksanaan pengembangan dan sertifikasi kompetensi bidang sumber daya air dan permukiman.&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;Fungsi :&lt;/p&gt;\r\n&lt;ol&gt;\r\n&lt;li&gt;penyusunan kebijakan teknis, rencana, dan program pengembangan dan sertifikasi kompetensi bidang sumber daya air dan permukiman;&lt;/li&gt;\r\n&lt;li&gt;koordinasi dan pembinaan teknis substantif pengembangan kompetensi bidang sumber daya air dan permukiman;&lt;/li&gt;\r\n&lt;li&gt;penyusunan dan standardisasi teknis, materi, serta tenaga pengajar dan pembimbing pengembangan kompetensi bidang sumber daya air dan permukiman;&lt;/li&gt;\r\n&lt;li&gt;pelaksanaan pengembangan dan sertifikasi kompetensi bidang sumber daya air dan permukiman;&lt;/li&gt;\r\n&lt;li&gt;pelaksanaan kerja sama sertifikasi pengembangan kompetensi bidang sumber daya air dan permukiman;&lt;/li&gt;\r\n&lt;li&gt;pemantauan, evaluasi, dan pelaporan pengembangan dan sertifikasi kompetensi bidang sumber daya air dan permukiman; dan&lt;/li&gt;\r\n&lt;li&gt;pelaksanaan urusan tata usaha dan rumah tangga pusat.&lt;/li&gt;\r\n&lt;/ol&gt;', 'Pusat_2/sdap.jpg', '', '', 'Aktif', '2022-03-24 10:20:25', '2022-03-25 00:12:37'),
(5, 119, 135, 'Pusat Pengembangan Kompetensi Jalan, Perumahan, dan Pengembangan Infrastruktur Wilayah', 'Ir. Rezeki Peranginangin M.Sc., M.M.', '&lt;p&gt;Jl. Abdul Hamid &amp;ndash; Cicaheum, Bandung&lt;/p&gt;', '(022) 7208024', '(022) 7208024', 'pusat3_bpsdm@pu.go.id', '&lt;div&gt;&lt;strong&gt;Tugas Pokok:&lt;/strong&gt;&lt;/div&gt;\r\n&lt;div&gt;Melaksanakan penyiapan penyusunan kebijakan teknis dan penyelenggaraan pendidikan dan pelatihan bidang jalan, jembatan, perumahan, permukiman, dan pengembangan infrastruktur wilayah.&lt;/div&gt;\r\n&lt;div&gt;&lt;strong&gt;Fungsi:&lt;/strong&gt;&lt;/div&gt;\r\n&lt;ol&gt;\r\n&lt;li&gt;penyusunan kebijakan teknis, rencana, dan program pengembangan dan sertifikasi kompetensi bidang jalan dan jembatan, perumahan, dan pengembangan infrastruktur wilayah;&lt;/li&gt;\r\n&lt;li&gt;koordinasi dan pembinaan teknis substantif pengembangan kompetensi bidang jalan dan jembatan, perumahan, dan pengembangan infrastruktur wilayah;&lt;/li&gt;\r\n&lt;li&gt;penyusunan dan standardisasi teknis, materi, serta tenaga pengajar dan pembimbing pengembangan kompetensi bidang jalan dan jembatan, perumahan, dan pengembangan infrastruktur wilayah;&lt;/li&gt;\r\n&lt;li&gt;pelaksanaan pengembangan dan sertifikasi kompetensi bidang jalan dan jembatan, perumahan, dan pengembangan infrastruktur wilayah;&lt;/li&gt;\r\n&lt;li&gt;pelaksanaan kerja sama sertifikasi pengembangan kompetensi bidang jalan dan jembatan, perumahan, dan pengembangan infrastruktur wilayah;&lt;/li&gt;\r\n&lt;li&gt;pemantauan, evaluasi, dan pelaporan pengembangan dan sertifikasi kompetensi bidang jalan dan jembatan, perumahan, dan pengembangan infrastruktur wilayah; dan&lt;/li&gt;\r\n&lt;li&gt;pelaksanaan urusan tata usaha dan rumah tangga pusat.&lt;/li&gt;\r\n&lt;/ol&gt;', 'Pusat_3/jpw.jpg', '-6.5397949', '106.6698157', 'Aktif', '2021-10-28 17:29:03', '2022-03-25 07:28:19'),
(6, 120, 136, 'Pusat Pengembangan Kompetensi Manajemen', 'Ir. Moeh Adam, M.M', '&lt;p&gt;Jalan Sapta Taruna Raya, Komplek PU, Pasar Jumat, Jakarta Selatan. 12310&lt;/p&gt;', '021-7511875', '021-7511875', 'pusat4_bpsdm@pu.go.id', '', 'pusat4.jpg', '', '', 'Aktif', '2021-11-22 06:48:33', NULL),
(7, 121, 147, 'Politeknik PU', 'Prof.Ir. Indratmo Soekarno, M.Sc., Ph.D', '&lt;p&gt;Jl. Prof. Sudarto, Tembalang, Kec. Tembalang, Kota Semarang, Jawa Tengah 50277&lt;/p&gt;', '0822-6512-1769', '', '', '&lt;p&gt;Politeknik Pekerjaan Umum&amp;nbsp;merupakan perguruan tinggi negeri (PTN) unggulan dalam bidang pembangunan infratruktur ke-PU-an, untuk mewujutkan penyelenggaraan negara yang terbuka dan berkomitmen untuk memberikan layanan infomrasi publik adalah sesuai dengan amanat Pasal 13 Undang- Undang Nomor 14 Tahun 2008 tentang Keterbukaan Informasi Publik (UU KIP), Kementerian Pekerjaan Umum dan Perumahan Rakyat sebagai salah satu Badan Publik telah membentuk Pejabat Pengelola Informasi dan Dokumentasi (PPID) melalui Keputusan Menteri Pekerjaan Umum dan Perumahan Rakyat Nomor: 674/KPTS/M/2015 tentang Penetapan Struktur Organisasi dan Penunjukan Pejabat Pengelola Informasi dan Dokumentasi Kementerian Pekerjaan Umum dan Perumahan Rakyat. PPID memiliki tugas dan wewenang dalam melakukan koordinasi pelaksanaan pelayanan informasi publik serta bertanggung jawab dan berkewajiban melaporkan kepada Direktur Politeknik Pekerjaan Umum.&lt;/p&gt;', 'politeknikpu_1.jpg', '', '', 'Aktif', '2022-03-24 07:56:41', '2022-03-25 00:54:12'),
(8, 122, 137, 'Balai Pengembangan Kompetensi Pekerjaan Umum dan Perumahan Rakyat Wilayah I Medan', 'Ahmad Kholidi Nasution, SST., MT', '&lt;p&gt;Jl. Sakti Lubis Jl. Busi No.7A, Siti Rejo I, Kec. Medan Kota, Kota Medan, Sumatera Utara 20219&lt;/p&gt;', '(061) 7866473', '', '', '&lt;p&gt;TUGAS POKOK :&lt;/p&gt;\r\n&lt;p&gt;&quot;Balai Pengembangan Kompetensi Pekerjaan Umum dan Perumahan Rakyat mempunyai tugas melaksanakan pendidikan dan pelatihan pegawai bidang pekerjaan umum dan perumahan rakyat.&quot;&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;FUNGSI :&lt;/p&gt;\r\n&lt;p&gt;1. Penyusunan rencana, program pendidikan dan pelatihan teknis dan kepemimpinan di wilayahnya;&lt;/p&gt;\r\n&lt;p&gt;2. Penyelenggaraan pendidikan dan pelatihan teknis dan kepemimpinan;&lt;/p&gt;\r\n&lt;p&gt;3. Pelaksanaan sistem informasi pendidikan dan pelatihan serta diseminasi/sosialisasi;&lt;/p&gt;\r\n&lt;p&gt;4. Pelayanan sarana pendidikan dan pelatihan;&lt;/p&gt;\r\n&lt;p&gt;5. Pemantauan dan evaluasi penyelenggaraan pendidikan dan pelatihan serta penyusunan laporan;&lt;/p&gt;\r\n&lt;p&gt;6. Pengelolaan kepegawaian, keuangan, tata persuratan dan tata kearsipan, perlengkapan, pengelolaan barang milik negara, pengelolaan penerimaan negara bukan pajak serta urusan rumah tangga Balai; dan&lt;/p&gt;\r\n&lt;p&gt;7. Pelaksanaan fungsi lain yang diberikan oleh Kepala Badan.&lt;/p&gt;', 'balai1.jpg', '', '', 'Aktif', '2022-03-24 12:41:50', NULL),
(9, 123, 138, 'Balai Pengembangan Kompetensi Pekerjaan Umum dan Perumahan Rakyat Wilayah II Palembang', 'Muhammad Nizar, S.E., M.T.', '&lt;p&gt;Jl. KS. Tubun No. 12, Lapangan Hatta, Palembang&lt;/p&gt;', '0711 - 359410', '0711 - 377251', 'badiklat2_bpsdm@pu.go.id', '&lt;p&gt;Tugas Pokok:&lt;/p&gt;\r\n&lt;p&gt;Balai Pengembangan Kompetensi Pekerjaan Umum dan Perumahan Rakyat mempunyai tugas melaksanakan pendidikan dan pelatihan pegawai bidang pekerjaan umum dan perumahan rakyat.&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;Fungsi:&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;ol&gt;\r\n&lt;li&gt;Penyusunan rencana, program pendidikan dan pelatihan teknis dan kepemimpinan di wilayahnya;&lt;/li&gt;\r\n&lt;li&gt;Penyelenggaraan pendidikan dan pelatihan teknis dan kepemimpinan;&lt;/li&gt;\r\n&lt;li&gt;Pelaksanaan sistem informasi pendidikan dan pelatihan serta diseminasi/sosialisasi;&lt;/li&gt;\r\n&lt;li&gt;Pelayanan sarana pendidikan dan pelatihan;&lt;/li&gt;\r\n&lt;li&gt;Pemantauan dan evaluasi penyelenggaraan pendidikan dan pelatihan serta penyusunan laporan;&lt;/li&gt;\r\n&lt;li&gt;Pengelolaan kepegawaian, keuangan, tata persuratan dan tata kearsipan, perlengkapan, pengelolaan barang milik negara, pengelolaan penerimaan negara bukan pajak serta urusan rumah tangga Balai; dan&lt;/li&gt;\r\n&lt;li&gt;Pelaksanaan fungsi lain yang diberikan oleh Kepala Badan.&lt;/li&gt;\r\n&lt;/ol&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;Wilayah Kerja:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Prov. Sumatera Selatan&lt;/li&gt;\r\n&lt;li&gt;Prov. Kep. Bangka Belitung&lt;/li&gt;\r\n&lt;li&gt;Prov. Jambi&lt;/li&gt;\r\n&lt;li&gt;Prov. Bengkulu&lt;/li&gt;\r\n&lt;li&gt;Prov. Lampung&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;Widyaiswara:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Dr. Ir. Dharma Nursani, M.Sc&lt;/li&gt;\r\n&lt;li&gt;Ir. Harris Hasudungan Batubara, M.Eng.Sc&lt;/li&gt;\r\n&lt;li&gt;Ir. Kemas Mohamad Nur Asikin, M.T&lt;/li&gt;\r\n&lt;li&gt;Ir. Tasripin Sartiyono, M.T&lt;/li&gt;\r\n&lt;/ul&gt;', 'dokumen/balaipalembang/balaipalembang.jpg', '-2.9790771', '104.7588111', 'Aktif', '2021-11-14 13:13:26', '2022-04-06 08:33:33'),
(10, 124, 139, 'Balai Pengembangan Kompetensi Pekerjaan Umum dan Perumahan Rakyat Wilayah III Jakarta', 'Drs. Haris Marzuki Susila', '&lt;p&gt;Jl. Sapta Taruna Raya, Komplek PU Pasar Jum&#039;at, Jakarta Selatan&lt;/p&gt;', '(021) 75918778 / 769', '(021) 75918778 / 769', 'pupr_bpsdm_bapekom3@pu.go.id', '&lt;p&gt;-&lt;/p&gt;', 'Balai_3/Gedung_Utama/GEDUNG_DRONE.png', '-6.284615708293823, 106.77377643905334', '-6.284615708293823, 106.77377643905334', 'Aktif', '2021-11-22 06:39:59', '2022-03-30 05:06:53'),
