(13, 127, 142, 'Balai Pengembangan Kompetensi Pekerjaan Umum dan Perumahan Rakyat Wilayah VI Surabaya', 'Amir Hamzah, ST., MT.', '&lt;p&gt;Jl. Gayung Kebonsari 48 Surabaya&lt;/p&gt;', '(031) 829 1040', '(031) 827 5847', 'bapekom6surabaya@pu.go.id', '&lt;p&gt;Tugas Pokok :&lt;/p&gt;\r\n&lt;p&gt;Balai Pengembangan Kompetensi Pekerjaan Umum dan Perumahan Rakyat mempunyai tugas melaksanakan pendidikan dan pelatihan pegawai bidang pekerjaan umum dan perumahan rakyat.&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;Fungsi :&lt;/p&gt;\r\n&lt;ol&gt;\r\n&lt;li&gt;Penyusunan rencana, program,dan anggaran pelaksanaan pendidikan dan pelatihan bidang pekerjaan umum dan perumahan rakyat;&lt;/li&gt;\r\n&lt;li&gt;Penyelenggaraan pendidikan dan pelatihan bidang pekerjaan umum dan perumahan rakyat;&lt;/li&gt;\r\n&lt;li&gt;Pelaksanaan sistem informasi pendidikan dan pelatihan serta diseminasi/sosialisasi;&lt;/li&gt;\r\n&lt;li&gt;Pelayanan sarana pendidikan dan pelatihan;&lt;/li&gt;\r\n&lt;li&gt;Pemantauan dan evaluasi penyelenggaraan pendidikan dan pelatihan serta penyusunan laporan;&lt;/li&gt;\r\n&lt;li&gt;Pengelolaan kepegawaian, keuangan, tata persuratan dan tata kearsipan, perlengkapan, pengelolaan barang milik negara, pengelolaan penerimaan negara bukan pajak serta urusan rumah tangga Balai; dan&lt;/li&gt;\r\n&lt;li&gt;\r\n&lt;div&gt;Pelaksanaan fungsi lain yang diberikan oleh Kepala Badan&lt;/div&gt;\r\n&lt;div&gt;&amp;nbsp;&lt;/div&gt;\r\n&lt;/li&gt;\r\n&lt;/ol&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;Wilayah Kerja:&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Prov. Jawa Timur (selain Kabupaten Ponorogo dan Kabupaten Pacitan)&lt;/li&gt;\r\n&lt;li&gt;Prov. Bali&lt;/li&gt;\r\n&lt;li&gt;Prov. Nusa Tenggara Barat&lt;/li&gt;\r\n&lt;li&gt;Prov. Nusa Tenggara Timur&lt;/li&gt;\r\n&lt;/ul&gt;', 'balai6.jpg', '', '', 'Aktif', '2022-03-25 00:25:59', NULL),
